import React from "react";
import { DataGrid } from "@mui/x-data-grid";
import { mockDataTeam } from "./data";

const PreviewTasks = () => {
  const columns = [
    { field: "id", headerName: "ID" },
    {
      field: "name",
      headerName: "Name",
      flex: 3,
    },
    {
      field: "email",
      headerName: "Email",
      flex: 3,
    },
    {
      field: "access",
      headerName: "Access Level",
      flex: 2,
    },
  ];
  return (
    <div>
      <DataGrid
        initialState={{
          pagination: {
            paginationModel: { pageSize: 5, page: 1 },
          },
        }}
        rows={mockDataTeam}
        columns={columns}
      />
    </div>
  );
};

export default PreviewTasks;
